import React from 'react';
import Hamburger from 'react-hamburgers';

class Menu extends React.Component {

  constructor(props) {
    super(props);
    this.state = { active: false };
  }

  render() {
    return (
      <div>
        <Hamburger
          active={this.state.active}
          type="slider"
          onClick={() => this.setState({ active: !this.state.active })}
        />
      </div>
    );
  }
}

export default Menu;
